import React, { Component } from 'react'

class Order extends Component{
    render(){
        return(
            <div
            style={{
                display: 'flex',
                justifyContent: 'center',
                alignItems: 'center',
                height: '90vh'
              }}
            >
                <h1>Book Hotel</h1>
            </div>
        )
    }
}

export default Order;
